foreignObject.div:
                      构造OralEvalSDKFactory.StartConfig对象

两种构造方式:

1.通过OralEvalSDKFactory.StartConfig getCfg(String txt);
                        ⇒ 启动评测后会读录音数据流来评测;


2.通过OralEvalSDKFactory.StartConfig(String oralText, String fileFullName) ⇒ 启动评测后会读文件流评测

                    读数据流,每次读3200byte ;

处理数据流获得实时音量, onVolume ;

回调数据流, onAudioData\onOpusData ;

发送数据流到服务端;
